import React from 'react';
import { Divider, Drawer, ListItem, ListItemIcon, ListItemText, Toolbar } from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import MailIcon from '@material-ui/icons/Mail';
import AccessibleIcon from '@material-ui/icons/Accessible';
import ChildCareIcon from '@material-ui/icons/ChildCare';
import ChildFriendlyIcon from '@material-ui/icons/ChildFriendly';
import EuroIcon from '@material-ui/icons/Euro';
import "./navdrawer.css";


class Navdrawer extends React.Component {
    constructor(props: any) {
        super(props);
        
    }
    render() {
        return (
            <div id="navdraw" className="NavigationDrawer lightmode">
                <rect className="Nav">
                    <Toolbar/>
                    <Divider />
                    <label className="sub">Nieuws Kanalen</label>
                    <div onClick={this.click} >
                        <ListItem button >
                            <ListItemIcon>
                                <AccessibleIcon />
                            </ListItemIcon>
                            <ListItemText primary="Belangrijk nieuws"/>
                        </ListItem>
                    </div>
                    <Divider />
                    <label className="sub">Chat Kanalen</label>                    
                    <ListItem button >
                        <ListItemIcon>
                            <ChildCareIcon />
                        </ListItemIcon>
                        <ListItemText primary="Publiek"/>
                    </ListItem>
                    <ListItem button >
                        <ListItemIcon>
                            <ChildFriendlyIcon />
                        </ListItemIcon>
                        <ListItemText primary="Team Genoten"/>
                    </ListItem>
                    <ListItem button >
                        <ListItemIcon>
                            <EuroIcon />
                        </ListItemIcon>
                        <ListItemText primary="one more channel cuz why not"/>
                    </ListItem>
                    <div onClick={this.click} >
                        <label className="sub">Andere Kanalen</label>
                    </div>
                </rect>
            </div>
        );
    }
    click() {
        let navdraw = document.getElementById("navdraw");
        navdraw?.classList.add("darkmode");
        navdraw.classList.remove("lightmode");
    }
}

export default Navdrawer;
